import React from 'react';
import './nav.css';

function Nav() {

  return (
    <div className="cover">
        <div className="navbar">
            <ul className='navContainer'>
                <li>Home</li>
                <li>About Me</li>
                <li>Portfolio</li>
                <li>Resume</li>
            </ul>
        </div>
    </div>
  );
}

export default Nav;
